Relationship.create([subject_id: (Resource.find_by literal: 'T0005528').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "تستعمل لكلا التسميتين ما قبل 1992, جمهورية يوغسلافيا الإتحادية الإشتراكية والتي كانت تتألف من ستة أعضاء وجمهورية يوغسلافيا الإتحادية التي كانت تتألف من عضوين.  لقد غيرت الأخيرة اسمها الى صربيا والجبل الأسود بتاريخ 4 شباط/فبراير 2003", language_id: (Language.find_by name: 'ar').id).id])
